import { Heading, Paragraph } from '@contentful/f36-components';
import tokens from '@contentful/f36-tokens';
import { css } from 'emotion';
import React from 'react';

const styles = {
   heading: css({
      marginBottom: '0px'
   })
}

function Variations(props) {
  return (
    <React.Fragment>
      <Heading element='h2' className={styles.heading}>Variations:</Heading>
      <Paragraph>To see Variations, create a Feature Flag</Paragraph>
    </React.Fragment>
  )
}

export default Variations;
